import { FunctionComponent } from "react"
import { CountryType } from "../types"

interface ICountryProps {
    country: CountryType
}

const Country: FunctionComponent<ICountryProps> = (props) => {
    const {country} = props
    return (
        <div>
            {country.name.common} - {country.capital}
        </div>
    )
}

export default Country
